import React,{ useEffect, useState } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';

function Form() {

    const [team, setTeam] = useState();
    const ddd = ['ddd','sss','rrrr'];

    const teamdata = async() =>{

        const dd = await axios.get('/api/team');
        
        for (const [index, value] of dd.data.entries()) {
            setTeam(<div>{value.name}</div>);
        }
        
    }

    const ddddssss =[];

    useEffect(() => {
        document.title = 'from';

        teamdata();

        ddd.forEach(e =>{
            console.log(e);
            ddddssss.push(<li>{e}</li>);
        })


    },[]);

    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>from</h1>
            {ddddssss}
        </>
    )
}

export default Form
